INSERT INTO `tbl_laporan` VALUES (2361, 2, 16, '', '                                    Mataram, 06 Desember 2022        \r\nNomor  	: 263/Not/XII/2022           	                                                		        Kepada Yth :\r\nLampiran    	: 01 (satu) Gabung                                                                                 Ketua Majelis Pengawas Daerah\r\nPerihal        	: Laporan Bulanan   \r\n\r\n            Untuk memenuhi Ketentuan pasal 61 ayat (1) Undang-undang nomor 30 tahun 2004 tentang Jabatan Notaris dan pasal 38 ayat (1) Peraturan Menteri Hukum dan Hak Asasi Manusia Republik  Indonesia  Nomor : M.02.PR.08.02, tahun 2004, tanggal 07 Desember 2004, dengan hormat kami sampaikan Laporan Bulan NOPEMBER 2022, berupa salinan-salinan (salinan lengkapnya terlampir) yang telah disahkan dari buku-buku : ----------------------------------------------------------\r\n\r\n1.    Daftar akta dari nomor urut 14.631 sampai dengan 14.839, yang terdiri dari :\r\na.	Akta Surat Kuasa Membebankan Hak Tanggungan terdiri dari 115 akta.\r\nb.	Akta Perjanjian Kredit/Pengakuan Hutang terdiri dari 56 akta.\r\nc.	Akta Perjanjian/Ikatan Jual Beli terdiri dari 07 akta.\r\nd.	Akta Kuasa terdiri dari 07 akta.\r\ne.	Akta Perjanjian Sewa Menyewa terdiri dari 05 akta\r\nf.	Akta Rapat Umum Pemegang Saham (RUPS) terdiri dari 03 akta.\r\ng.	Akta Addendum Perjanjian Kredit terdiri dari 03 akta.\r\nh.	Akta Pendirian Perseroan Komanditer (CV) terdiri dari 02 akta\r\ni.	Akta Pernyataan terdiri dari 02 akta\r\nj.	Akta Jaminan Fidusia terdiri dari 01 akta.\r\nk.	Akta Konsen Roya terdiri dari 01 akta.\r\nl.	Akta Perjanjian Pinjam Pakai terdiri dari 01 akta.\r\nm.	Akta Wasiat terdiri dari 01 akta.\r\nn.	Akta Penyerahan Barang Jaminan Hutang terdiri dari 01 akta.\r\no.	Akta Perjanjian Pengosongan terdiri dari 01 akta.\r\np.	Akta Perjanjian Kawin terdiri dari 01 akta.\r\nq.	Akta Perubahan CV terdiri dari 01 akta.\r\nr.	Akta Pemberian Jaminan terdiri dari 01 akta.\r\n\r\n2.	Daftar Surat Dibawah Tangan yang Dibukukan, terdiri dari:\r\na.	N I H I L.\r\n\r\n3.      Daftar Surat Dibawah Tangan yang Disahkan, dari nomor urut 40 sampai dengan 41 terdiri dari  :\r\na.	Surat Perjanjian Pinjaman terdiri dari 01 surat.\r\nb.	Surat Syarat-Syarat Ketentuan Umum Perjanjian Kredit terdiri dari 01 surat.\r\n\r\n4.      Daftar Protes seperti yang dimaksud dalam pasal 143 C dan pasal 218 C Kitab Undang-Undang Hukum Perniagaan, yang terdiri dari :   N I H I L. \r\n\r\n         Demikian agar menjadi maklum  dan seperlunya.\r\n                                                                                                \r\n\r\nHormat saya,                                                                                                                                     Notaris di Mataram\r\n\r\n\r\n\r\n\r\n\r\n( I GEDE SUTAMA, SH )\r\n', 'file/11._LAP._NOT._NOPEMBER_2022.docx', 538, 'konfirmasi', 365, NULL, NULL, '2022-12-06 11:44:26', '2022-12-06 13:48:19', NULL, NULL, NULL);
