INSERT INTO `tbl_laporan` VALUES (5447, 2, 10, '', 'Untuk memenuhi ketentuan dalam Pasal 61 ayat (1) Undang-undang Nomor 2 Tahun 2014 atas perubahan Undang-undang Nomor 30 tahun 2004 tentang Jabatan Notaris, dengan ini saya sampaikan laporan bulanan untuk bulan maret berupa salinan-salinan yang telah disahkan dari buku-buku : 1. Laporan Bulanan Akta Notaris : nihil akta 2. Laporan Surat-Surat dibawah tangan yang disahkan (Legalisasi) : nihil  nomor. 3. Laporan Surat-Surat dibawah tangan yang bukukan (Warmeking) : 1', 'file/laporan_bulan_mei3.pdf', 624, 'selesai', 366, 'selesai', NULL, '2024-06-12 09:53:21', '2024-06-19 13:13:50', '2024-07-02 07:55:10', NULL, NULL);
