INSERT INTO `tbl_laporan` VALUES (8309, 2, 10, '', '01. SURAT KUASA MEMBEBANKAN HAK TANGGUNGAN, Tanggal 10-05-2025, Penghadap (1. TUAN HAMZAR RASYIDI, 2. TUAN KHAIRUL LUTFAN ZAIN (KOPERASI SIMPAN PINJAM DAN PEMBIAYAAN SYARIAH (KSPPS) EL RAHMA LOMBOK RINJANI)). 02. AKTA JAMINAN FIDUSIA, Tanggal 10-05-2025, Penghadap (1. TUAN HAMZAR RASYIDI, 2. TUAN KHAIRUL LUTFAN ZAIN (KOPERASI SIMPAN PINJAM DAN PEMBIAYAAN SYARIAH (KSPPS) EL RAHMA LOMBOK RINJANI)). 03. KOPERASI DESA MERAH PUTIH PRINGGABAYA KECAMATAN PRINGGABAYA, Tanggal 17-05-2025, Penghadap (1. TUAN ALIMUDDIN, SARJANA PERTANIAN, 2. TUAN KHAIRUL AZMI, 3. TUAN HAJI HASBULLAH). 04. KOPERASI DESA MERAH PUTIH PRINGGABAYA UTARA KECAMATAN PRINGGABAYA, Tanggal 17-05-2025, Penghadap (1. TUAN FATHURRAHMAN, 2. TUAN LALU IKHSAN, 3. NONA LIA JUNIARTI). 05. KOPERASI DESA MERAH PUTIH TEKO KECAMATAN PRINGGABAYA, Tanggal 17-05-2025, Penghadap (1. TUAN HILMI ZAINI, SARJANA PENDIDIKAN, 2. TUAN MUHAMMAD ZAINUDDIN, 3. NYONYA NORATUL FAHRI ZAIN). 06. KOPERASI DESA MERAH PUTIH LABUHAN LOMBOK KECAMATAN PRINGGABAYA, Tanggal 17-05-2025, Penghadap (1. TUAN ABDUL HARIS MUNANDAR, 2. TUAN PAHRURROZI, 3. TUAN ARKI AGUNG SETIAWAN). 07. KOPERASI DESA MERAH PUTIH SERUNI MUMBUL KECAMATAN PRINGGABAYA, Tanggal 17-05-2025, Penghadap (1. TUAN LALU MUHAMMAD ALI, 2. TUAN ACHMAD WIRANADI HAKIM, 3. NYONYA LAILI TANTINI), 08. KOPERASI DESA MERAH PUTIH  BAGIK PAPAN KECAMATAN PRINGGABAYA, Tanggal 17-05-2025, Penghadap (1. NYONYA BAIQ SARWANI, 2. TUAN MUHAMMAD ZAINUDIN, 3. NONA RINA SUPYANI), 09. KOPERASI DESA MERAH PUTIH KERUMUT KECAMATAN PRINGGABAYA, Tanggal 20-05-2025, Penghadap (1. TUAN HERI TAMAWAN JAYA, 2. TUAN EDY SUYANTO ALQUSAERY, 3. TUAN MUHAMMAD NUH), 10. KOPERASI DESA MERAH PUTIH TELAGA WARU KECAMATAN PRINGGABAYA, Tanggal 27-05-2025, Penghadap (1. TUAN NASIHIN, 2. NONA IRYA RISWANA, 3. NONA SAPIRA ELPAYANA). 11. KOPERASI DESA MERAH PUTIH SURABAYA UTARA KECAMATAN SAKRA TIMUR, Tanggal 28-05-2025, Penghadap (1. TUAN USMAN, SARJANA PENDIDIKAN ISLAM, 2. TUAN MOHAMMAD ZAINUDDIN, 3. NYONYA NURSILAM), 12. KOPERASI DESA MERAH PUTIH LEPAK, Tanggal 28-05-2025, Penghadap (1. TUAN LALU KERTAWAN, 2. TUAN MUHAMMAD IWAN TAUFIK, 3. NONA DINDA AYU LARA SAKY). 13. KOPERASI DESA MERAH PUTIH LEPAK TIMUR, Tanggal 28-05-2025, Penghadap (1. TUAN MUHAMAD PADIL, 2. TUAN ZULKARNAEN, 3. NONA EVA DIANA TAUHID). 14. KOPERASI DESA MERAH PUTIH TANAK GADANG KECAMATAN PRINGGABAYA, Tanggal 30-05-2025, Penghadap (1. TUAN ASRORI, 2. TUAN KASFI, 3. NONA ELI SUKMAWATI). 15. KOPERASI DESA MERAH PUTIH DANGER KECAMATAN MASBAGIK, Tanggal 30-05-2025, Penghadap (1. TUAN MANSUR, 2. NONA APRILIANA, 3. NYONYA SITI DIAH RATNASARI, SARJANA EKONOMI);  BUKU DAFTAR LEGALISASI. 02. SURAT KETERANGAN PERIKATAN JAMINAN DENGAN AKTA SKMHT, Tanggal 10-05-2025, Penghadap (TUAN HAMZAR RASYIDI);', 'file/LAPORAN_NOT_MEI_2025.pdf', 552, 'konfirmasi', 366, NULL, NULL, '2025-06-25 10:51:57', '2025-06-30 07:17:45', NULL, NULL, NULL);
