INSERT INTO `tbl_laporan` VALUES (8572, 2, 11, '', '01. KOPERASI DESA MERAH PUTIH &quot;BATUYANG KECAMATAN PRINGGABAYA&quot;, Tanggal 2-6-2025, Penghadap (1. TUAN DOCTORANDUS RUSTAM, 2. TUAN KHAERUL AMRI, 3. NYONYA NIA PRIASTUTI). 02. KOPERASI DESA MERAH PUTIH &quot;ANGGARAKSA KECAMATAN PRINGGABAYA&quot;, Tanggal 3-6-2025, Penghadap (1. TUAN MILIANDI SUKMAWAN, 2. TUAN YUSPA ISMAIL, 3. NONA MARYATIKA MIFTAHUL R). 03. YAYASAN INKREANESIA BANGUN BANGSA, Tanggal 3-6-2025, Penghadap (1. TUAN YUS HARUDIAN PUTRA,SARJANA SEKOLAH TINGGI PEMERINTAHAN, 2. TUAN HAJI MAHMUD YUNUS, SARJANA HUKUM). 04. KOPERASI DESA MERAH PUTIH &quot;APITAIK KECAMATAN PRINGGABAYA&quot;, Tanggal 3-6-2025, Penghadap (1. TUAN HARYANTO, 2. TUAN ABD HALIK, SARJANA PENDIDIKAN, 3. NONA SILVA WARDIANA). 05. KOPERASI DESA MERAH PUTIH &quot;GUNUNG MALANG KECAMATAN PRINGGABAYA&quot;, Tanggal 5-6-2025, Penghadap (1. TUAN ABDUL RAHIM, 2. TUAN MULI HARDI HARSONO, 3. NYONYA HIMMAH). 06. KOPERASI DESA MERAH PUTIH &quot;SURABAYA KECAMATAN SAKRA TIMUR&quot;, Tanggal 5-6-2025, Penghadap (1. TUAN NOPIAN HARYADI, 2. TUAN MUHAMMAD PAIZUL NIZAM HADI, 3. NONA ISTI AZAH SAPUR). 07. KOPERASI DESA MERAH PUTIH &quot;PAOKMOTONG&quot;, Tanggal 10-6-2025, Penghadap (1. TUAN DONI MURLAN, SARJANA EKONOMI, 2. TUAN ALI AMRUSNI, 3. NONA HAERAYARAH). 08. KOPERASI DESA MERAH PUTIH &quot;MASBAGIK UTARA&quot;, Tanggal 10-6-2025, Penghadap (1. TUAN LALU RATHSA JOHAN PAHLAWAN ABDUSSAHID, 2. TUAN SURYA ADITYA SUKRONI, 3. NYONYA HERLINA ASRI). 09. KOPERASI DESA MERAH PUTIH &quot;POHGADING TIMUR KECAMATAN PRINGGABAYA&quot;, Tanggal 10-6-2025, Penghadap (1. TUAN MUHAMMAD AHDAR ARYA SUTHA, 2. TUAN ROHENDI, 3. TUAN SUWANDI). 10. KOPERASI DESA MERAH PUTIH &quot;POHGADING KECAMATAN PRINGGABAYA LOMBOK TIMUR&quot;, Tanggal 10-6-2025, Penghadap (1. TUAN ANHAR, 2. TUAN MOHAMMAD TAKDIR, 3. TUAN KAHARUDIN). 11. KOPERASI DESA MERAH PUTIH &quot;KUMBANG KECAMATAN MASBAGIK&quot;, Tanggal 11-6-2025, Penghadap (1. NYONYA WIDYA KUSWATUN HARWIN, 2. TUAN HASAN BASRI, 3. NONA NURDIANA). 12. KOPERASI DESA MERAH PUTIH &quot;MASBAGIK TIMUR&quot;, Tanggal 11-6-2025, Penghadap (1. TUAN AZHARUDDIN, 2. TUAN IMRAN, 3. NONA EKA NIRMALA APRIANI). 13. KOPERASI DESA MERAH PUTIH &quot;KESIK KECAMATAN MASBAGIK&quot;, Tanggal 20-6-2025, Penghadap (1. TUAN AHMAD HADI RAMDHANI, 2. TUAN ABDUL MALIK JAYAZI, 3. TUAN BAGUS PRIBADI).', 'file/LAPORAN_NOT_JUNI_2025.pdf', 552, 'konfirmasi', 363, NULL, NULL, '2025-07-18 13:36:10', '2025-07-21 08:50:17', NULL, NULL, NULL);
