INSERT INTO `tbl_pengaduan` VALUES (32, 2, 89, 'pada tanggal 24 Agustus 2017 bertempat di Bank BTN Mataram dihadapan notaris I NYOMAN ALIT,S.H.,M.Kn kami menandatangi akta perjanjian kredit nomor 75 dan juga menandatangi beberapa kertas kosong yang sudah ada nama kami , yang saya tanya saat itu untuk apa dan dijelaskan notaris untuk keperluan hak tanggungan , belakangan baru kami ketahui bahwa kertas kosong yang sudah ada nama kami yang kami tandatangani dan cap jempol tanggal 24 Agustus 2017 digunakan untuk menerbitkan surat kuasa membebankan hak tanggungan nomor 104 tertanggal 22 nopermber 2017 dan sertifikat hak tanggungan nomor 1842/2017 atas sertifikat hak guna bangunan nomor 2 atas nama pt.rajawali property lombok dan sertifikat hak tanggungan nomor 261/2018 atas sertifikat hak milik nomor 248 atas nama sahri', 'kami menerima surat persetujuan pemberian kredit /SP2K dari Bank BTN Mataran tanggal 15 Agustus 2017 dengan plafon kredit Rp.4,326,000,000 ( empat milyar tiga ratus dua puluh enam juta rupiah , tanggal 24 Agustus 2017 kami membayar biaya notaris dan biaya akad kredit sejumlah Rp.96,000,000 ( sembilan puluh enam juata rupiah ) yang kami setorkan ke rekening pt.rajawali property lombok dan didebet langsung oleh Bank BTN Mataram , tanggal 28 Agustus 2017 pencairan kredit pertama sejumlah Rp.1,606,000,000 ( satu milyar enam ratus enam juta rupiah ) tanggal 10 Oktober 2017 pencairan kredit kedua sejumlah Rp.500,000,000 ( lima ratus juta rupiah ) tangaal 14 nopember 2017 pencairan kredit ketiga sejumlah Rp.300,000,000 ( tiga ratus juta rupiah )', 'file/pengaduan_not.pdf', 373, NULL, 'konfirmasi', 364, NULL, NULL, '2021-04-08 13:21:40', '2021-04-08 15:11:27', NULL, NULL);
INSERT INTO `tbl_pengaduan` VALUES (33, 2, 61, 'Notaris atas nama RATIH FEBRIANTI SH., M.Kn tempat melakukan pengikatan jaminan Kredit atas nasabah SOPIAN HADI (Nasabah) dengan PT. BPR Segara Anak Kencana dan Notaris sudah mengeluarkan Cover Note bahwa pengikatan jaminan tersebut dalam proses APHT. Namun sebelum pengikatan APHT selesai Notaris RATIH membuat akta Jual Beli terhadap jaminan tersebut, sementara kredit Nasabah tersebut belum lunas.', 'Sampai sekarang PT. BPR Segara Anak Kencana belum menerima baik sertifikat maupun pengikatan APHT Jaminan tersebut, sementara kredit sudah posisi MACET dan Jaminan terswebut sudah terjual.', 'file/SURAT_KE_NOTARIS.pdf', 380, NULL, 'konfirmasi', 363, NULL, NULL, '2021-04-22 07:19:05', '2021-04-23 07:39:35', NULL, NULL);
