INSERT INTO `tbl_pengaduan` VALUES (36, 2, 85, 'URAIAN PERISTIWA HUKUM Pada tahun 2016 kami meminjam uang di Bank BPRS PATUH BERAMAL CAKRA NEGARA sebesar Rp.500.000.000 ( lima ratus juta rupiah ) dengan akad Pembiayaan Murabahah dengan ketentuan angsuran pokok satu juta rupiah setiap bulan dan marjin sebesar dua persen setiap bulan atau Rp.10.000.000 ( sepuluh juta rupiah ) setiap bulan sehingga angsuran setiap bulan Rp.11.000.000 ( sebelas juta rupiah )  Setiap tahun Bank BPRS PATUH BERAMAL CAKRA NEGARA memperpanjang pinjaman tersebut , terahir kami menandatangani perpanjangan  Perjanjian Pembiayaan Murabahah pada tanggal 31 Januari 2019 di hadapan Notaris / PPAT ZULFAHRI ,SH, M.Kn sisa hutang Rp.256.000.000 ( dua ratus lima puluh enam juta rupiah ) degan ketentuan angsuran pokok Rp.1000.000 ( satu juta rupiah ) dan angsuran marjin dua persen dari sisa hutang  Rp.5.120.000 ( lima juta seratus dua puluh ribu rupiah ) sehingga angsuran setiap bulan Rp.6.120.000 ( enam juta seratus dua puluh ribu rupiah )  Tahun 2020 sisa hutang kami Rp.245.000.000 ( dua r', 'Berdasarkan  keterangan yang kami dapatkan  dari BPN Lombok Tengah , kami mendapatkan bukti bahwa LALU DAUD NURJADI sudah membuat APHT atas nama AKHMAD SALEHUDIN  sejak tahun 2017 , sementara kami tidak kenal dan tidak pernah bertemu dengan LALU DAUD NURJADI', 'file/APHT_H.AKHMAD_SALEHUDIN_001.jpg', 373, NULL, 'konfirmasi', 364, 'mohon maaf bapak/ibu notaris atas nama ZULFAHRI,S.H.,M.Kn berada di wilayah kota Mataram...silahkan melaporkan ke MPDN KOTA MATARAM', NULL, '2021-10-12 21:03:11', '2021-10-18 14:57:08', '2021-10-19 07:32:04', NULL);
INSERT INTO `tbl_pengaduan` VALUES (37, 2, 154, 'pengurusan CV tanpa SK menkumham', 'Mohom dibantu perusahaan kami CV ibanezblack dengan NIB : 8120010212914\r\n\r\nPengurusan CV kami lakukan melalui notaris Bambang Gede di lombok, sudah habis hampir 8 juta tapi kami belum mendapatkan SK menkumham sejak 2018. alasannya CV tidak mendapatkan SK menkumham. bagaimana cara prosedur untuk mendapatkan SK tersebut? apakah gratis? atau ada biaya tambahan lagi. karna kami butuhkan untuk keperluan usaha kami', 'file/D5A63465-9C40-4A3E-94B2-D80D7EC22002.png', 463, NULL, 'konfirmasi', 366, NULL, NULL, '2022-01-26 01:29:21', '2022-01-31 07:18:33', NULL, NULL);
INSERT INTO `tbl_pengaduan` VALUES (39, 2, 128, '     Nomor	: 010/LP/BMP/II/2022 Lampiran	:	1 (satu) Gabung Perihal	:	Pengaduan Dugaan Pelanggaran Kode Etik Notaris atau Pelanggaran Pelaksanaan Jabatan Notaris   Kepada Yth. Ketua Majelis Pengawas Daerah Notaris Kabupaten Lombok Barat d/a. Kanwil KEMENKUMHAM Prov. NTB 	  Dengan hormat, Kami yang bertanda tangan di bawah ini : BASRI MULYANI, S.H., M.H., adalah Advokat pada kantor BM &amp; PARTNERS, yang beralamat di Perumahan Puncang Hijau Blok H/3 Sandik, Kecamatan Batulayar Kabupaten Lombok Barat, Provinsi Nusa Tenggara Barat, domisili elektronik: basri.mulyani@gmail.com, oleh karenanya sah bertindak untuk dan atas nama serta mewakili kepentingan hukum dari: ------------------------------------------------------------- 1.	BAIQ WIDIASTI WIRANING, NIK. 5202024210720002, lahir di Jakarta, 2 Oktober 1972, pekerjaan Karyawan Swasta, bertempat tinggal di Jelantik, Desa Jelantik, Kecamatan Jonggat, Kabupaten Lombok Tengah; ----------------- 2.	BAIQ IRMA SASTI WIRANING, NIK. 5202025411770002, lahir di Jakarta, 14 November 1977, pekerjaan Wiraswasta, bertempat tinggal di Pedaleman, Desa Jelantik, Kecamatan Jonggat, Kabupaten Lombok Tengah, selanjutnya disebut sebagai ------------------------- PARA PELAPOR ----------------------------  Adapun uraian pengaduan Dugaan Pelanggaran Kode Etik Notaris atau Pelanggaran Pelaksanaan Jabatan Notaris adalah sebagai berikut : -------------------------------------- 1.	Bahwa Para Pelapor ada memiliki tanah pertanian yang diterima waris dari orang tuanya alm. LALU WIRANING yang tercatat dalam 2 (dua) Sertifikat Hak Milik (SHM) terletak di Desa Jelantik Kecamatan Jonggat Kabupaten Lombok Tengah, masing-masing yaitu : a.	SHM Nomor: 946/Jelantik, Surat Ukur Nomor: 148/Jelantik/2002, tertanggal 29-10-2002, luas 4.710 m2, tercatat atas nama BAIQ WIDIASTI WIRANING; dan b.	SHM Nomor: 945/Jelantik, Surat Ukur Nomor: 146/Jelantik/2002, tertanggal 29-10-2002, luas 4.710 m2, tercatat atas nama BAIQ IRMA SASTI WIRANING, sekitar 10 are telah dijual kepada pihak lain dan tersisa adalah seluas 3.710 m2; 2.	Bahwa sebelum kesepakatan jual beli dilakukan dihadapan notaris Para Pelapor beberapa kali melakukan pertemuan dengan pihak penjual yakni sdr. MUHAMMAD ILYAS di Desa Jelantik kediaman Pelapor (Bq. Widiasti Wiraning), sampai akhirnya disepakati harga Rp. 20.000.000,- (dua puluh juta rupiah) per-are. Selanjutnya Pihak pembeli (Muh. Ilyas) menawarkan Notaris yang telah dia kenal dan sering menggunakan jasanya yakni Notaris SRI NURLAILI, SH., M.Kn yang berkedudukan di Kabupaten Lombok Barat (selanjutnya disebut Terlapor);   3.	Bahwa, Para Pelapor dan suami pada hari Rabu tanggal 24 Oktober 2018 bersama-sama dengan pihak pembeli (Muh. Ilyas) menghadap ke Notaris SRI NURLAILI, SH., M.Kn (Terlapor) di Labuapi-Lombok Barat untuk menandatangani Akta Perikatan Jual Beli Bertahap yang dibuat dihadapan Terlapor selaku Notaris di kantornya, yang pada saat itu Para Pelapor dan suami hanya dimintakan KTP (kartu identitas), setelah selesai diketik kemudian dibacakan Akta tersebut oleh Terlapor 1, sampai pada soal kesepakatan jual beli yakni Rp. 18.000.000,- (delapan belas juta rupiah) per-are, suami Para Pelapor keberatan dari yang telah disepakati disebelum, tetapi oleh pembeli (Muh. Ilyas) memaksa Para Pelapor menerimanya tanpa ada penjelasan dari Terlapor seharusnya seperti apa semestinya dalam sebuah akta tersebut dibuat sebelum ditandatangani adalah kesepakatan para pihak; 4.	Bahwa adapun isi akta yang dibuat dihadapan Terlapor selaku Notaris di kantornya, Para Pelapor adalah berkedudukan sebagai pihak yang terlibat langsung dalam akta (menjadi pihak dalam akta) atau pihak yang berkepentingan langsung terhadap akta tersebut, semestinya Terlapor menurut ketentuan Pasal 15 ayat (2) huruf e UU No. 2 Tahun 2014 tentang Perubahan Atas UU No. 30 Tahun 2004 tentang Jabatan Notaris, yang menyatakan: &ldquo;memberikan penyuluhan hukum sehubungan dengan pembuatan Akta&rdquo;. Penjelasan atas isi akta tersebut sudah menjadi kewajiban dari notaris untuk menjelaskan sejauhmana kedudukan dan perlindungan hukum kepada Para Pelapor jika dikemudian hari terjadi perbuatan wanprestasi dari salah satu pihak atau dari Terlapor sendiri selaku notaris yang tidak memimak pada salah satu pihak, sebagaimana ketentuan Pasal 3 ayat (4) Perubahan Kode Etik Notaris Tahun 2015 yang berbunyi: &ldquo;Berprilaku jujur, mandiri, tidak berpihak, Amanah, seksama, penuh rasa tanggungjawab, berdasarkan peraturan perundang-undangan dan isi sumpah jabatan Notaris&rdquo;; 5.	Bahwa dalam Akta Perikatan Jual Beli Bertahap Nomor 15, tanggal 24-10-2018 antara BAIQ WIDIASTI WIRANING (Pelapor I) dengan MUHAMMAD ILYAS, atas obyek jual beli pada angka 1 huruf a diatas harga jual belinya adalah Rp. 18.000.000,- (delapan belas juta rupiah) per-are dengan jumlah keseluruhannya adalah Rp. 847.000.000,- (delapan ratus empat puluh tujuh juta rupiah). Pembayaran yang disepakati antara Baiq Widiasti Wiraning dengan Muhammad Ilyas dalam perikatan tersebut dilakukan secara bertahap/angsuran sebagai berikut: -	Pada saat penandatangan akta dibayarkan sebesar Rp. 50.000.000,- (lima puluh juta rupiah); -	Tahap kedua akan dibayarkan sebesar Rp. 355.000.000,- (tiga ratus lima puluh lima juta rupiah), setelah keluarnya Kredit Yasa Griya (KYG) dan Kredit Pemilikan Lahan (KPL) dari Bank atau paling lambat tanggal 28-02-2019; -	Tahap ketiga atau pelunasan sebesar Rp. 442.000.000,- (empat ratus empat puluh dua juta rupiah), paling lambat setahun setelah pembayaran kedua atau paling lambat tanggal 28-02-2020. 6.	Bahwa dalam Akta Perikatan Jual Beli Bertahap Nomor 13, tanggal 24-10-2018 antara BAIQ IRMA SASTI WIRANING (Pelapor II) dengan MUHAMMAD ILYAS, atas obyek jual beli pada angka 1 huruf b diatas yang disepakati adalah Rp. 18.000.000,- (delapan belas juta rupiah) per-are dengan jumlah keseluruhannya adalah Rp. 667.800.000,- (enam ratus enam puluh tujuh juta delapan ratus ribu rupiah). Pembayaran yang disepakati antara Baiq Irma Sasti Wiraning dengan Muhammad Ilyas dalam perikatan tersebut dilakukan secara bertahap/angsuran sebagai berikut: -	Pada saat penandatangan akta dibayarkan sebesar Rp. 50.000.000,- (lima puluh juta rupiah); -	Tahap kedua akan dibayarkan sebesar Rp. 355.000.000,- (tiga ratus lima puluh lima juta rupiah), setelah keluarnya Kredit Yasa Griya (KYG) dan Kredit Pemilikan Lahan (KPL) dari Bank atau paling lambat tanggal 28-02-2019; -	Tahap ketiga atau pelunasan sebesar Rp. 262.800.000,- (dua ratus enam puluh dua juta delapan ratus ribu rupiah), paling lambat setahun setelah pembayaran kedua atau paling lambat tanggal 28-02-2020. 7.	Bahwa pelaksanaan Perikatan Jual Beli Bertahap Nomor 13 dan Nomor 15, tanggal 24-10-2018, dihadapan Terlapor  selaku Notaris di kantornya, para pihak telah memahami dan sepakat melakukan pembayaran dengan 3 (tiga) tahap sebagaimana dimaksud pada angka 5 dan 6 diatas dengan ketentuan waktu pembayaran yaitu : tahap pertama, penandatangan akta, tahap kedua, setelah keluarnya Kredit Yasa Griya (KYG) dan Kredit Pemilikan Lahan (KPL) dari Bank atau paling lambat tanggal 28-02-2019, tahap ketiga, paling lambat setahun setelah pembayaran kedua atau paling lambat tanggal 28-02-2020. Setiap pembayaran akan dibuatkan kwitansi sebagai pembayaran yang sah dan akta ini dapat pula menjadi kwitansi pembayaran tahap pertama dan tahap kedua yang sah dan diakui para pihak; 8.	Bahwa untuk pembayaran tahap ketiga atau pelunasan wajib dilakukan dihadapan Terlapor selaku Notaris di kantornya. Karena pada saat penandatangan Akta Perikatan Jual Beli Bertahap Nomor 13 dan Nomor 15, tanggal 24-10-2018, Para Pelapor diminta menyerahkan SHM Nomor: 946/Jelantik dan SHM Nomor: 945/Jelantik oleh Terlapor selaku Notaris di kantornya, untuk dititipkan sebagai jaminan pelunasan tahap ketiga sebagaimana bukti tanda terima penyerahan sertifikat; 9.	Bahwa pembayaran tahap pertama dan tahap kedua dilakukan secara transfer ke rekening para pelapor, dimana pembayaran tahap pertama sesuai dengan isi perjanjian dalam Akta Perikatan Jual Beli Bertahap Nomor 13 dan Nomor 15 pada saat penandatangan akta langsung dibayarkan, sedangkan pembayaran tahap kedua yang juga dilakukan secara transfer pada tanggal 12 Pebruri 2019 sudah tidak lagi memenuhi isi perjanjian yang telah disepakti, bahkan tidak ada penjelasan kepada Para Pelapor mengapa yang ditransfer hanya sebesar Rp. 300.000.000,- (tiga ratus juta rupiah) dari kesepakatan dalam akta sebesar  Rp. 355.000.000,- (tiga ratus lima puluh lima juta rupiah), sehingga terdapat kekurangan sebesar Rp. 55.000.000,- (lima puluh lima juta rupiah). Bahkan menurut keterangan Muh. Ilyas kepada BAIQ WIDIASTI WIRANING (Pelapor I) melalui saluran telpon pada saat akan transfer pembayaran tahap kedua, akan dilakukan oleh Terlapor (Notaris SRI NURLAILI, SH., M.Kn); 10.	Bahwa sejak pembayaran tahap kedua dengan cara transfer yang sudah tidak lagi memenuhi isi perjajian dalam Akta Perikatan Jual Beli Bertahap Nomor 13 dan Nomor 15, tanggal 24-10-2018, pihak pembeli Muh. Ilyas dalam memeuhi isi perjanjian sudah tidak beriktikat baik, pembayaran dilakukan semaunya dengan cara &ldquo;mohon maaf&rdquo; seperti membeli kacang. Para pelapor kemudian mendatangani Terlapor selaku Notaris di kantornya pada tanggal 16 Juli 2020 atau 5 (lima) bulan setelah jatuh tempo pembayaran pelaksanaan perjanjian aquo. Jawaban yang Para Pelapor terima dari Terlapor adalah &ldquo;Sertifikatnya sekarang sudah di Halim Lombok Tengah dan bukan sudah tanggungjawab saya&rdquo;. Atas pernyataan Terlapor tersebut Para Pelapor sangat keberatan dan menyatakan pada Terlapor, &ldquo;saya menyerahkan sertifikat untuk dititipkan karena sampai ada pelunasan&rdquo;. Bahkan pada waktu pertemuan tersebut Para pelapor menawarkan addendum kepada Terlapor selaku Notaris di kantornya untuk merubahkan atau memperbaiki isi dari Akta Perikatan Jual Beli Bertahap Nomor 13 dan Nomor 15, tanggal 24-10-2018 yang telah jatuh tempo, akan tetapi tidak ada tanggapan dari Terlapor. 11.	Bahwa Perjanjian berdasarkan kesepakatan yaitu perikatan jual beli bertahap akan memberikan perlindungan hukum yang sama besarnya antara pihak penjual sebagai pemilik tanah atau bangunan, serta pihak pembeli selaku pemilik uang (dana) yang akan membayar harga atas transaksi jual beli yang akan dilakukan. klausul penyimpanan sertifikat yang tertera dan tercantum dalam akta  perikatan jual beli bertahap merupakan bagian dari tugas dan fungsi seorang Notaris untuk memberikan jaminan kepastian dan perlindungan hukum bagi para pihak yang terikat dalam akta perikatan jual beli bertahap tersebut. Kepastian dan perlindungan hukum bagi para pihak harus nyata dirasakan sedemikian rupa sehingga bagi para pihak merasa terlindungi hak-hak dan kewajiban-kewajibannya di dalam akta perikatan jual beli bertahap, untuk menjaga jikalau nantinya ada permasalahan hukum yang mungkin timbul. 12.	Bahwa Tindakan-tindakan yang telah Terlapor lakukan sebagaimana terurai diatas, dapat diduga merupakan pelanggaran terhadap kode etik notaris dan pelanggaran pelaksanaan jabatan notaris sebagaimana ketentuan UU Jabatan Notaris. Karena dalam ketentuan 16 ayat (1) Undang &ndash; undang No. 2 Tahun 2014 Tentang Perubahan Atas UU No. 30 Tahun 2004 Tentang Jabatan Notaris yang berbunyi :  &ldquo;Dalam menjalankan jabatannya, Notaris wajib: bertindak amanah, jujur, saksama, mandiri, tidak berpihak, dan menjaga kepentingan pihak yang terkait dalam perbuatan hukum;&rdquo;   13.	Bahwa akhirnya Para Pelapor menggunakan jasa advokat Abdul Kasim, SH untuk melayangkan SOMASI kepada Terlapor hingga 2 (dua) kali dilayangkan Somasi tersebut, Terlapor kemudian mengirimkan pesan melalui aplikasi WhatsApp pada tanggal 12 Agustus 2020 dengan menyatakan, &ldquo;Semeton kenapa saya yang di Somasi, kenapa tidak Ilyas&rdquo;. Sejak saat itu Para Pelapor tidak pernah lagi menghubungi Terlapor; 14.	Bahwa kesulitan pembayaran pelunasan tanah tersebut Muh. Ilyas menawarkan kepada Para Pelapor untuk mengambil rumah diatas tanah miliknya yang belum dibayar lunas tersebut dengan harga Rp. 130.000.000,- (serratus tiga puluh juta rupiah) pada tanggal 17 September 2021 yang pada waktu itu dibuatkan kwitansi dan diberikan sertifikat yang bangunan rumah belum ada. Pelapor II (Baiq Irma Sasti Wiraning) yang mengetahui sertifikat tanah yang menjadi obyek Perikatan Jual Beli Bertahap Nomor 13 dan Nomor 15, tanggal 24-10-2018 ternyata telah berbalik nama ke PT. MAKRIF BINA SEJAHTERA dan dalam Sertifikat in casu merupakan Hak Tanggungan pada PT Bank Tabungan Negara, dalam artian rumah yang belum dibangun dan tanahnya yang diberikan kepada Para Pelapor adalah tanah yang masih menjadi kredit di Bank Tabungan Negara. Karena 2 (dua) hal yang tidak memenuhi syarat jual beli tersebut Pelapor II (Baiq Irma Sasti Wiraning) menolak tawaran Muh. Ilyas. 15.	Bahwa sekitar bulan November 2021, Para Pelapor melayangkan laporan dugaan praktek mafia tanah ke Satgas Mafia Tanah pada Kejaksaan Agung RI. Pada bulan Januari 2022 laporan Para Pelapor mendapatkan tanggapan dari Kejaksaan Tinggi Nusa Tenggara Barat atas pelimpahan pelaporan dari Kejaksaan Agung RI. Pada pokoknya Para Pelapor melaporkan terkait dengan perubahan kepemilikan tanah milik Para Pelapor kepada Muh. Ilyas yang dilakukan oleh Terlapor (Notaris) tanpa sepengetahuan Para Pelapor yang telah menitipkan sertifikat miliknya pada waktu penandatangan Akta Perikatan Jual Beli Bertahap; 16.	Bahwa dari penyelidikan kejaksaan Para Pelapor kemudian mengetahui dasar peralihan hak tersebut didasarkan atas surat kuasa menjual yang dibuatkan oleh Terlapor selaku Notaris di kantornya yang senyatanya tidak pernah Para Pelapor buat dan tandatangani. Selanjutnya Para Pelapor dan kuasa hukum telah berusaha untuk dapat menemui Terlapor selaku Notaris di kantornya agar dapat diberikan Salinan Surat Kuasa Menjual aquo yang isi terdapat nilai obyek transaksi jual beli tanah milik Para Pelapor sejumlah Rp. 25.000.000.000,- (dua puluh lima juta rupiah) dan memberikan kuasa kepada Muh. Ilyas untuk mengalihkannya. Akan tetapi dari Terlapor tidak ada tanggapan dan iktikat baiknya untuk menyelesaikan permasalahan ini sedari awal sejak tidak dipenuhinya isi dari Akta Perikatan Jual Beli Bertahap Nomor 13 dan Nomor 15, tanggal 24-10-2018 yang Terlapor buat tersebut, pada saat pembayaran tahap kedua dilakukan dan bahkan Terlapor sendiri yang mentransfer kerening Pelapor I menurut keterangan Muh. Ilyas; 17.	Bahwa berdasarkan Pasal 55 Undang-Undang No. 2 Tahun 2014 Tentang Perubahan Atas UU No. 30 Tahun 2004 Tentang Jabatan Notaris yang berbunyi: &ldquo;Notaris hanya dapat memberikan, memperlihatkan, atau memberitahukan isi Akta, Grosse Akta, Salinan Akta atau Kutipan Akta, kepada orang yang berkepentingan langsung pada Akta, ahli waris, atau orang yang memperoleh hak, kecuali ditentukan lain oleh peraturan perundang-undangan. 18.	Bahwa berdasarkan Pasal 55 Undang &ndash; undang No. 2 Tahun 2014 Tentang Perubahan Atas UU No. 30 Tahun 2004 Tentang Jabatan Notaris tersebut diatas, maka Pelapor adalah orang / pihak yang dapat diberikan Salinan Akta; 19.	Bahwa terhadap penyimpanan sertifikat hak atas tanah pada perikatan jual beli bertahap yang disepakati bersama oleh para pihak kepada Terlapor selaku Notaris di kantornya yang dituangkan dalam akta perikatan jual beli bertahap melalui janji-janji yang disepakati bersama oleh kedua belah pihak dan atas konesp perjanjian yang Terlapor selaku Notaris di kantornya buat. Tindakan penyimpanan sertifikat hak atas tanah pada Terlapor selaku Notaris di kantornya dilakukan untuk memberikan kepastian dan perlindungan hukum kepada masing-masing pihak di dalam perikatan jual beli bertahap. Kewenangan dan kewajiban Terlapor selaku Notaris di kantornya harus memberikan suatu fungsi perlindungan hukum yang diterima oleh para pihak. Untuk memastikan fungsi perlindungan dan kepastian hukum tersebut, Terlapor selaku Notaris di kantornya harus dapat memberikan manfaat hukum secara nyata dalam bentuk kepastian hukum terhadap penyimpanan sertifikat hak atas tanah kepada para pihak. Akan tetapi kenyataan yang terjadi sebagaimana telah Para Pelapor uraikan diatas posisi Para Pelapor tidak berimbang akibat dari pelanggaran etik yang dilakukan oleh Terlapor berdasarkan ketentuan Pasal 3 ayat (4) Perubahan Kode Etik Notaris Tahun 2015 yang berbunyi: &ldquo;Berprilaku jujur, mandiri, tidak berpihak, Amanah, seksama, penuh rasa tanggungjawab, berdasarkan peraturan perundang-undangan dan isi sumpah jabatan Notaris&rdquo;. 20.	Bahwa pelanggaran etik yang Terlapor lakukan dengan tidak mengawal secara tegas Akta Perikatan Jual Beli Bertahap Nomor 13 dan Nomor 15, tanggal 24-10-2018 yang Terlapor buat dikantornya, proses transfer pembayaran Tahap Kedua yang Terlapor lakukan kepada Pelapor I dengan jumlah yang tidak sesuai dengan kesepakatan, Penyataan Terlapor yang menyatakan penyimpanan sertifikat bukan lagi menjadi tanggungjawabnya karena telah dilimpahkan kepada Notaris HALIM NATAATMAJA, SH, dan terakhir pelanggaran serius tentang adanya dugaan tindak pidana pemalsuan yang dilakukan Terlapor dengan membuat Surat Kuasa Menjual yang tidak pernah dilakukan oleh Para Pelapor;  21.	Bahwa tanggung jawab hukum menurut Kitab Undang-Undang Hukum Perdata (BW) adalah tanggung jawab dengan unsur kesalahan (kesengajaan dan kelalaian) sebagaimana tercermin pada Pasal 1365, &ldquo;setiap yang melanggar hukum dan membawa kerugian kepada orang lain, mewajibkan orang yang menimbulkan kerugian itu karena kesalahannya untuk mengganti kerugian tersebut&rdquo;. Tanggung jawab dengan unsur kesalahan khususnya kelalaian sebagaimana terdapat dalam Pasal 1366, &ldquo;setiap orang bertanggung jawab, bukan hanya atas kerugian yang disebabkan perbuatan, melainkan juga atas kerugian yang disebabkan kelalaian atau kesengajaan, dan tanggung jawab mutlak (tanpa kesalahan) sebagaimana terdapat dalam Pasal 1367, &ldquo;seseorang tidak hanya bertanggung jawab atas kerugian yang disebabkan perbuatannya sendiri, melainkan juga atas kerugian yang disebabkan perbuatan orang yang menjadi tanggungannya, atau disebabkan barang yang berada dibawah pengawasannya. 10.	Bahwa tindakan yang telah Terlapor lakukan tersebut sangat merugikan Pelapor yang berkepentingan karena tidak adanya kepastian atas pekaksanaan Akta Perikatan Jual Beli Bertahap, padahal jabatan notaris merupakan jabatan kepercayaan dan yang menjalankan jabatannya tersebut harus dapat dipercaya dalam menjalankan tugas dan segala yang diperbuatnya sesuai dengan peraturan perundang-undangan yang berlaku;       11.	Bahwa berdasarkan uraian tersebut diatas dengan ini Para Pelapor memohon dengan kerendahan hati kepada Ketua Majelis Pengawas Notaris Daerah Kabupaten Lombok Barat. agar :        	1.	Menerima pengaduan Para Pelapor; 	 	2.	Melakukan sidang untuk. memeriksa adanya dugaan pelanggaran Kode Etik Notaris atau pelanggaran pelaksanaan jabatan Notaris dan memberitahukan nya kepada Para Pelapor terhadap hasil keputusan sidang tersebut; 	3. Memerintahkan Terlapor untuk memberikan seluruh salinan akta yang tidak dibuat dan ditandatangani Para Pelapor;', 'Kasus hukum sedang ditangani Kejaksaan Tinggi NTB terkait laporan Mafia Tanah', 'file/Surat_Kuasa002.pdf', 467, NULL, 'selesai', 366, 'Sudah diadakan mediasi oleh MPD dan diberi rekomendasi. Selanjutnya kasus saat ini sudah ditangani oleh MPW. Terima kasih', NULL, '2022-02-19 16:21:49', '2022-02-24 08:45:06', '2022-07-19 08:49:21', NULL);
