INSERT INTO `tbl_pengaduan` VALUES (58, 2, 87, 'Penahanan Sertifikat Tanah Oleh Notaris, Ketidakjelasan Akta Minuta, Protokol Notaris', 'Sebelumnya saya mewakili Ibu saya; Sri Wahyuningsih dalam membuat aduan ini di Aplikasi LAPOR! dan ditindaklanjuti untuk membuat laporan di aplikasi siparis.id, kronologi kasus yang menimpa Ibu SW terkait juga dengan dugaan pelanggaran Kode Etik Notaris sebagai berikut:\r\n\r\nPada hari sabtu tanggal 3 Juli 2021 Lalu ALi Murdan, SH., M.Kn (Notaris), Bu Rusminah (Perantara) dan Pak Iwan (Perantara) datang ke rumah Ibu Sri Wahyuningsih (pemilik tanah/penjual) di Gerung - Lombok Barat, kedatangan tiga orang tersebut bermaksud akan membayar tanah Ibu SW yang berlokasi di Labuan Tereng Kecamatan Lembar, Lombok Barat.\r\n\r\nPada pertemuan tersebut diadakan transaksi jual beli tanah: Notaris, BR dan PI memberikan uang sebesar Rp 17.000.000 kepada Ibu SW sebagai uang muka, dan pelunasannya akan diberikan kepada Ibu SW 3 bulan kedepan yakni bulan Oktober 2021 dengan kesepakatan apabila dalam 3 bulan tidak dilunasi maka uang muka hangus. Dari uang muka yang diserahkan Notaris meminta kepada Ibu SW uang &quot;jasa/administrasi/apalah sebutannya&quot; sebesar Rp 500.000 dan Ibu SW memberikan.\r\n\r\nPada proses transaksi Ibu SW meminta AJB atau surat apalah hitam diatas putih yang membuktikan dan menerangkan bahwa telah terjadi transaksi jual-beli tanah kepada Notaris, namun ditimpali ada dikantor semua tidak dibawa kemudian Ibu SW meminta kwitansi jual-beli bermaterai namun ditimpali lagi masih pagi toko-toko yang jual materai belum buka oleh mereka, intinya surat-surat yang harus dikeluarkan oleh Notaris sebagai kepanjangan tangan Negara tidak ada karena Notaris beralasan surat-surat dikantor semua.\r\n\r\nKemudian Notaris meminta kepada Ibu SW sertifikat tanah asli untuk dibawa, Ibu SW mempertanyakan namun dipastikan lagi oleh Notaris bahwa aturannya seperti itu, Ibu SW memberikan 2 (dua) sertifikat asli dan meminta agar Notaris membuat surat yang menerangkan bahwa sertifikat dibawa oleh Notaris, Notaris menulis surat di kertas folio bergaris dengan stempel basah.\r\n\r\nSelang beberapa hari Ibu SW meminta kepada Notaris kelanjutan dari dokumen resmi tentang AJB namun Notaris terkesan mengelak terus sampai saat ini.\r\n\r\n***\r\nBukankah ketika sudah melewati batas waktu kesepakatan seharusnya perjanjian jual-beli gugur dengan sendirinya?\r\nKarena melewati batas waktu pelunasan Ibu SW meminta haknya kembali berupa sertifikat tanah asli.\r\n\r\nYang menjadi pertanyaan saya adalah\r\n1. Minuta Akta yang merupakan bagian dari Protokol Notaris wajib dibuat oleh Pejabat Publik dalam menjalankan jabatannya sebagai Notaris, namun tidak pernah ada?\r\n2. Atas dasar apa Notaris menahan sertifikat tanah asli yang jual-beli tersebut telah BATAL dengan sendirinya karena pelunasan melebihi batas waktu yang telah disepakati?\r\n3. Langkah apa yang harus ditempuh Ibu SW untuk memperoleh kembali hak-nya berupa sertifikat tanah asli?\r\n\r\nTerima kasih atas perhatian dan tindak lanjutnya. ????', 'file/20210704_064742.jpg', 491, NULL, 'selesai', 364, 'sudah dikirimkan rekomendasi ke MPW', NULL, '2022-05-25 17:37:26', '2022-05-27 07:40:46', '2023-12-05 08:26:20', NULL);
