INSERT INTO `tbl_pengaduan` VALUES (61, 2, 61, 'Notaris/PPAT Ratih Fibrianti, S.H., M.Kn patut diduga tidak amanah, tidak jujur dan tidak seksama untuk menjalankan jabatannya sebagaimana Pasal 16 UUJN karena patut diduga memiliki peran atas jual-beli bidang tanah yang masih terikat PPJB atas nama Alm. Juan Setiadi Widjaja (Pewaris) ke Pihak lain;', 'Dengan Hormat,\r\nSaya yang bertandatangan di bawah ini:\r\nNama	:	Suzan Susanto\r\nNIK	:	3174105803800004\r\nAlamat	:	Jl Pluit Timur Raya No 34, RT 017 RW 006, Kelurahan Pluit, Kecamatan Penjaringan, Jakarta Utara (sesuai KTP)\r\n\r\nSelaku Pengadu/Pelapor atas adanya dugaan notaris melanggar kode etik notaris atau pelanggaran pelaksanaan Jabatan Notaris (JN) sebagaimana diatur dalam Undang Republik Indonesia Nomor 2 Tahun 2014 Tentang Perubahan Atas Undang-Undang Nomor 30 Tahun 2004 Tentang Jabatan Notaris (UUJN) yang diduga dilakukan oleh: Notaris/PPAT Ratih Fibrianti,S.H., M.Kn \r\n\r\nAdapun aduan/laporan ini didasarkan pada hal-hal berikut:\r\n1.	Bahwa Saya sesuai Akta Perkawinan 1871CPK16022110061 pada tanggal 9 Oktober 2009 (terlampir) adalah istri dari mendiang Juan Setiadi Widjaja (Pewaris) dan wali yang sah untuk mengurus harta waris dari Pewaris yang ditinggalkan kepada ketiga anaknya yaitu Kimberly Constantia Widjaja, Katie Natasha Widjaja, dan James Arthur Widjaja (Ahli Waris) sebagaimana sesuai penetapan PN Jakarta Utara Nomor 854/PDT.P/2019/PN.Jkt.U dan Akta Keterangan Hak Waris Nomor 03 tanggal 10 Oktober 2019 yang dibuat oleh Notaris Reflan Rasyid, Notaris di Kota Bandar Lampung (terlampir);\r\n2.	Bahwa Pewaris telah melakukan Pembelian 26 Bidang Tanah yang berlokasi di Desa Menceh dan Desa Gelanggang, Kecamatan Sakra Timur, Kabupaten Lombok Timur, Nusa Tenggara Barat;\r\n3.	Bahwa proses Pengikatan Jual Beli (PPJB) dan/atau Akta Jual Beli (AJB)  ke-26 Bidang Tanah tersebut dilakukan dihadapan Notaris/PPAT Ratih Fibrianti,S.H., M.Kn.;\r\n4.	Bahwa pada saat Saya tengah mengurus objek waris termasuk ke-26 Bidang Tanah tersebut, saya menemukan fakta bahwa sebagian bidang tanah yang telah diikatkan PPJB oleh Pewaris dihadapan Notaris/PPAT Ratih Fibrianti, S.H., M.Kn telah beralihan kepemilikan berdasarkan Akta Jual Beli yang dibuat oleh Notaris/PPAT Wina Ratna Bidari, S.H., M.Kn;\r\n5.	Bahwa setelah Saya telusuri kepada Pihak-pihak yang menjual tanah kepada Pewaris, mereka mengakui telah menjual bidang tanah yang telah diikatkan PPJB kepada Pewaris;\r\n6.	Bahwa Pihak Penjual menyatakan penjualan bidang tanah yang telah diikatkan PPJB kepada Pewaris dilakukan  dihadapan Notaris/PPAT Wina Ratna Bidari, S.H., M.Kn dan diketahui oleh Notaris/PPAT Ratih Fibrianti,S.H., M.Kn;\r\n7.	Bahwa menurut keterangan Pihak Penjual, dalam proses jual-beli tersebut terdapat beberapa pertemuan yang dihadiri oleh Notaris/PPAT Ratih Fibrianti,S.H., M.Kn dan  Notaris/PPAT Wina Ratna Bidari, S.H., M.Kn;\r\n8.	Bahwa atas tindakan Notaris/PPAT Ratih Fibrianti,S.H., M.Kn dan  Notaris/PPAT Wina Ratna Bidari, S.H. yang melakukan peralihan atas bidang tanah yang telah diikatkan PPJB kepada Pewaris, saya dan ahli waris telah secara nyata dirugikan baik materil maupun immateril;\r\n9.	Bahwa Notaris/PPAT Ratih Fibrianti,S.H., M.Kn dan  Notaris/PPAT Wina Ratna Bidari, S.H., M.Kn. patut diduga tidak amanah, tidak jujur dan tidak seksama untuk menjalankan jabatannya sebagaimana Pasal 16 UUJN;\r\n10.	Bahwa berdasarkan hal tersebut Saya memohon dengan sangat kepada Majelis Pengawas Wilayah Notaris untuk melakukan pemeriksaan sesuai Pasal 73 UUJN pada : Notaris/PPAT Ratih Fibrianti, S.H., M.Kn yang patut diduga memiliki peran atas jual-beli bidang tanah yang masih terikat PPJB atas nama Pewaris ke Pihak lain (Terlampir dokumentasi penandatanganan Akta PPJB/AJB di Kantor Notaris Ratih Fibrianti, namun saat ini sebagian bidang tanah tersebut dialihkan ke Pihak lain dengan sepengetahuan Notaris Ratih Fibrianti);\r\n11.	Bahwa apabila terdapat hal-hal yang perlu dibicarakan lebih lanjut terkait Kasus ini, maka mohon untuk menghubungi saya di Nomor: +62 811-1992-279 , Email: Suzankoo88@gmail.com Alamat:  Jl Pluit Timur Raya No 34, RT 017 RW 006, Kelurahan Pluit, Kecamatan Penjaringan, Jakarta Utara (sesuai KTP)\r\n\r\nDemikian Pengaduan ini saya sampaikan, besar harapan saya Majelis Pengawas Wilayah Notaris menindaklanjuti Pengaduan ini dengan melakukan Pemeriksaan dan dapat menanggapi Pengaduan ini dalam waktu 5 (lima) hari sejak Pengaduan ini diterima. Atas perhatian dan kerjasamanya, saya ucapkan terima kasih.\r\n', 'file/DOKUMENTASI_DI_KANTOR_NOTARIS_RATIH.pdf', 598, NULL, 'konfirmasi', 363, NULL, NULL, '2023-11-16 13:28:02', '2023-11-30 09:51:26', NULL, NULL);
INSERT INTO `tbl_pengaduan` VALUES (62, 2, 53, 'Notaris/PPAT Wina Ratna Bidari, S.H., M.Kn. patut diduga tidak amanah, tidak jujur dan tidak seksama untuk menjalankan jabatannya sebagaimana Pasal 16 UUJN karena patut diduga telah membuat Akta Jual Beli bidang tanah yang diketahui masih terikat PPJB atas nama Pewaris kepada Pihak lain.', 'Dengan Hormat,\r\nSaya yang bertandatangan di bawah ini:\r\nNama	:	Suzan Susanto\r\nNIK	:	3174105803800004\r\nAlamat	:	Jl Pluit Timur Raya No 34, RT 017 RW 006, Kelurahan Pluit, Kecamatan Penjaringan, Jakarta Utara (sesuai KTP)\r\n\r\nSelaku Pengadu/Pelapor atas adanya dugaan notaris melanggar kode etik notaris atau pelanggaran pelaksanaan Jabatan Notaris (JN) sebagaimana diatur dalam Undang Republik Indonesia Nomor 2 Tahun 2014 Tentang Perubahan Atas Undang-Undang Nomor 30 Tahun 2004 Tentang Jabatan Notaris (UUJN) yang diduga dilakukan oleh:\r\nNotaris/PPAT Wina Ratna Bidari, S.H., M.Kn;\r\nAdapun aduan/laporan ini didasarkan pada hal-hal berikut:\r\n1.	Bahwa Saya sesuai Akta Perkawinan 1871CPK16022110061 pada tanggal 9 Oktober 2009 (terlampir) adalah istri dari mendiang Juan Setiadi Widjaja (Pewaris) dan wali yang sah untuk mengurus harta waris dari Pewaris yang ditinggalkan kepada ketiga anaknya yaitu Kimberly Constantia Widjaja, Katie Natasha Widjaja, dan James Arthur Widjaja (Ahli Waris) sebagaimana sesuai penetapan PN Jakarta Utara Nomor 854/PDT.P/2019/PN.Jkt.U dan Akta Keterangan Hak Waris Nomor 03 tanggal 10 Oktober 2019 yang dibuat oleh Notaris Reflan Rasyid, Notaris di Kota Bandar Lampung (terlampir);\r\n2.	Bahwa Pewaris telah melakukan Pembelian 26 Bidang Tanah yang berlokasi di Desa Menceh dan Desa Gelanggang, Kecamatan Sakra Timur, Kabupaten Lombok Timur, Nusa Tenggara Barat;\r\n3.	Bahwa proses Pengikatan Jual Beli (PPJB) dan/atau Akta Jual Beli (AJB)  ke-26 Bidang Tanah tersebut dilakukan dihadapan Notaris/PPAT Ratih Fibrianti,S.H., M.Kn.;\r\n4.	Bahwa pada saat Saya tengah mengurus objek waris termasuk ke-26 Bidang Tanah tersebut, saya menemukan fakta bahwa sebagian bidang tanah yang telah diikatkan PPJB oleh Pewaris dihadapan Notaris/PPAT Ratih Fibrianti, S.H., M.Kn telah beralihan kepemilikan berdasarkan Akta Jual Beli yang dibuat oleh Notaris/PPAT Wina Ratna Bidari, S.H., M.Kn;\r\n5.	Bahwa setelah Saya telusuri kepada Pihak-pihak yang menjual tanah kepada Pewaris, mereka mengakui telah menjual bidang tanah yang telah diikatkan PPJB kepada Pewaris;\r\n6.	Bahwa Pihak Penjual menyatakan penjualan bidang tanah yang telah diikatkan PPJB kepada Pewaris dilakukan  dihadapan Notaris/PPAT Wina Ratna Bidari, S.H., M.Kn dan diketahui oleh Notaris/PPAT Ratih Fibrianti,S.H., M.Kn;\r\n7.	Bahwa menurut keterangan Pihak Penjual, dalam proses jual-beli tersebut terdapat beberapa pertemuan yang dihadiri oleh Notaris/PPAT Ratih Fibrianti,S.H., M.Kn dan  Notaris/PPAT Wina Ratna Bidari, S.H., M.Kn;\r\n8.	Bahwa atas tindakan Notaris/PPAT Ratih Fibrianti,S.H., M.Kn dan  Notaris/PPAT Wina Ratna Bidari, S.H. yang melakukan peralihan atas bidang tanah yang telah diikatkan PPJB kepada Pewaris, saya dan ahli waris telah secara nyata dirugikan baik materil maupun immateril;\r\n9.	Bahwa Notaris/PPAT Ratih Fibrianti,S.H., M.Kn dan  Notaris/PPAT Wina Ratna Bidari, S.H., M.Kn. patut diduga tidak amanah, tidak jujur dan tidak seksama untuk menjalankan jabatannya sebagaimana Pasal 16 UUJN;\r\n10.	Bahwa berdasarkan hal tersebut Saya memohon dengan sangat kepada Majelis Pengawas Wilayah Notaris untuk melakukan pemeriksaan sesuai Pasal 73 UUJN pada : Notaris/PPAT Wina Ratna Bidari, S.H., M.Kn. yang patut diduga telah membuat Akta Jual Beli bidang tanah yang diketahui masih terikat PPJB atas nama Pewaris kepada Pihak lain (Terlampir Bukti keterangan dari Kantor Pertanahan Lombok Timur bahwa bidang tanah yang telah diikatkan PPJB/AJB oleh Alm. Juan Setiadi Widjaja telah beralih berdasarkan akta dari Notaris Wina Ratna Bidari;\r\n11.	Bahwa apabila terdapat hal-hal yang perlu dibicarakan lebih lanjut terkait Kasus ini