INSERT INTO `tbl_pengaduan` VALUES (63, 2, 89, 'URAIAN PERISTIWA HUKUM Bahwa adapun dasar dan dalil hukum diajukannya  Pengaduan ini sebagai berikut:  1.	Bahwa PARA PENGADU memiliki perusahaan yang bernama PT. RAJAWALI PROPERTY LOMBOK bergerak di bidang Properti, yang mana PENGADU 1 sebagai Direktur dan PENGADU 2 sebagai Komisaris sebagaimana tercantum dalam Akta Nomor: 113, tanggal 29 Agustus 2016, yang dibuat dihadapan RETNO KUSBANDINI, S.H., M.Kn, Notaris di Kabupaten Lombok Tengah, Anggaran Dasar Perseroan mana telah memperoleh pengesahan dari Menteri Hukum dan Hak Asasi Manusia Republik Indonesia tertanggal 31 Agustus 2016, Nomor: AHU-0038770.AH.01.01.TAHUN 2016 dan Anggaran Dasar Perseroan mana telah dirubah dengan Akta Berita Acara Rapat Umum Luar Biasa PT. RAJAWALI PROPERTY LOMBOK Nomor: 24, tanggal 27 Juli 2017, yang dibuat dihadapan RETNO KUSBANDINI, S.H., M.Kn, Notaris di Kabupaten Lombok Tengah, perubahan Anggaran Dasar Perseroan mana telah dilaporkan pada Kementerian Hukum dan Hak Asasi Manusia Republik Indonesia, sebagaimana dibuat dalam Surat Penerimaan Pemberitahuan Perubahan Anggaran Dasar Perseroan Nomor: AHU-AH.01.03-0159781 tertanggal 7 Agustus 2017;   2.	Bahwa sejak tahun 2016 PARA PENGADU hendak berencana membangun perumahan di wilayah Desa Nyerot, Kecamatan Jonggat, Kabupaten Lombok Tengah, kemudian tepat pada tahun 2017 PARA PENGADU mengajukan Permohonan Kredit Untuk Pembiayaan Pembelian Lahan, Konstruksi Bangunan, Sarana dan Prasarana kepada PT. BANK TABUNGAN NEGARA (Persero) Tbk  yang kemudian PARA PENGADU memberi nama Perumahan Permata Agung Risidence;  3.	Bahwa untuk menunjukkan keseriusan PARA PENGADU atas pengajuan Permohonan Kredit yang telah diajukan kepada PT. BANK TABUNGAN NEGARA (Persero) Tbk, ada beberapa syarat dan ketentuan yang ditetapkan oleh PT. BANK TABUNGAN NEGARA (Persero) Tbk, maka PARA PENGADU memenuhi syarat tersebut dengan menyerahkan lampiran permohonan berupa berkas/dokumen kepada PT. BANK TABUNGAN NEGARA (Persero) Tbk, yaitu sebagai berikut:  a.	Akta Pendirian Perseroan, AD/ART dan Akta Perubahan; b.	SK KEMENKUMHAM; c.	TDP, NPWP, SITU dan berkas lainnya; d.	PARA PENGADU juga telah menyerahkan kelengkapan dokumen jaminan, yaitu: ?	Sertipikat Hak Milik No. 66, tanggal 7 Januari 1982, Surat Ukur No. 677/1981 tanggal 31 Desember 1981, Luas: 12.350 M2, atas nama pemegang hak: HAJI MOHAMAD NASIB, terletak di Desa Nyerot, Kecamatan Jonggat, Kabupaten Lombok Tengah, Provinsi Nusa Tenggara Barat;  4.	Bahwa setelah PT. BANK TABUNGAN NEGARA (Persero) Tbk menerima kelengkapan berkas/dokumen sebagaimana tersebut pada angka 3 di atas, beberapa hari kemudian pada tahun 2017 PT. BANK TABUNGAN NEGARA (Persero) Tbk melakukan beberapa tahapan seperti survei awal dan survei lanjutan, yaitu:  a.	Menilai kelayakan usaha PARA PENGADU; b.	Menekan risiko akibat tidak terbayarnya kredit; c.	Menghitung kebutuhan kredit yang layak; d.	Memeriksa keabsahan kepemilikan barang yang dijaminkan oleh PARA PENGADU; e.	Memeriksa status barang yang dijaminkan oleh PARA PENGADU dan lain-lain;  Berdasarkan hasil survei awal dan survei lanjutan yang dilakukan di atas, PT. BANK TABUNGAN NEGARA (Persero) Tbk meminta jaminan/agunan tambahan atas jaminan pokok di atas sehingga PARA PENGADU menyerahkan kelengkapan dokumen jaminan berikutnya kepada PT. BANK TABUNGAN NEGARA (Persero) Tbk, yaitu:      ?	Sertipikat Hak Milik No. 248, tanggal 28 Desember 2018, Surat Ukur No. 253/Mertak Tombok/2012 tanggal 28 Desember 2012, Luas: 3.398 M2, atas nama pemegang hak: SAHRI (PENGADU 2), terletak di Desa Mertak Tombok, Kecamatan Praya, Kabupaten Lombok Tengah, Provinsi Nusa Tenggara Barat;  Sehingga berdasarkan uraian di atas, PARA PENGADU telah dan hanya menyerahkan 2 (dua) kelengkapan dokumen jaminan Sertipikat Hak Milik kepada PT. BANK TABUNGAN NEGARA (Persero) Tbk;     5.	Bahwa beberapa hari kemudian PT. BANK TABUNGAN NEGARA (Persero) Tbk menyetujui Permohonan Kredit yang diajukan oleh PARA PENGADU sebagaimana Perihal: Surat Persetujuan Pemberian Kredit/SP2K Nomor: 1574/S/Mtr.II/CMLU/VIII/2017 tanggal 15 Agustus 2017 sejumlah Rp4.326.000.000,- (empat milyar tiga ratus dua puluh enam juta rupiah) yang diperuntukkan untuk Pembiayaan Pembelian Lahan, Konstruksi Bangunan, Sarana dan Prasarana Perumahan Permata Agung Risidence terletak di Desa Nyerot, Kecamatan Jonggat, Kabupaten Lombok Tengah;  6.	Bahwa faktanya 2 (dua) kelengkapan dokumen jaminan Sertipikat Hak Milik sebagaimana tersebut pada angka 4 di atas diserahkan terlebih dahulu kepada PT. BANK TABUNGAN NEGARA (Persero) Tbk baru kemudian persetujuan pemberian kredit dikeluarkan, hal mana surat persetujuan sebagaimana maksud pada angka 5 di atas bukan tanpa jaminan karena tida mungkin PT. BANK TABUNGAN NEGARA (Persero) Tbk mencairkan dana milyaran tanpa melihat dan melakukan survei terhadap kelayakan dan kemampuan PARA PENGADU untuk menyelesaikan tanggungjawabnya sebagai nasabah/debitur;    7.	Bahwa, sehingga pada tanggal 24 Agustus 2017 PARA PENGADU diundang oleh PT. BANK TABUNGAN NEGARA (Persero) Tbk untuk menandatangani semua Akta yang berhubungan dengan kredit yang sudah disetujui termasuk  Akta Perjanjian Kredit Nomor: 75, tanggal 24 Agustus 2017 yang sudah disiapkan dan  dibuat oleh TERADU selaku Notaris , hal mana Akta Nomor: 75 ditandatangani di kantor PT. BANK TABUNGAN NEGARA (Persero) Tbk Cabang Mataram bukan ditandatangani di kantor TERADU selaku Notaris serta tanpa dihadiri  oleh 2 (dua) orang saksi dan Akta in cassu saat itu tanpa dibacakan di hadapan dan PARA PENGADU saat itu mengira bahwa TERADU akan membuat akta sesuai fakta-fakta yang ada saat itu  Bahwa berdasarkan uraian fakta hukum di atas, maka tindakan TERADU bertentangan dan telah melanggar Pasal 16 ayat (1) huruf m Undang-Undang  Nomor 30 Tahun 2004 tentang Jabatan Notaris, yang mengatakan:  &ldquo;(1) Dalam menjalankan jabatannya, Notaris berkewajiban:  &ldquo;m. membacakan akta di hadapan penghadap dengan dihadiri oleh paling sedikit 2 (dua) orang saksi, atau 4 (empat) orang saksi khusus untuk pembuatan akta wasiat di bawah tangan, dan ditandatangani pada saat itu juga oleh penghadap, saksi, dan Notaris;  Bahwa atas tindakan tersebut di atas, maka jelas bahwa TERADU telah melakukan PELANGGARAN KODE ETIK NOTARIS DAN/ATAU PELANGGARAN PELAKSANAAN JABATAN NOTARIS sebagaimana bunyi Pasal 16 ayat (1) huruf m Undang-Undang  Nomor 30 Tahun 2004 tentang Jabatan Notaris di atas;  8.	Bahwa setelah peristiwa sebagaimana angka 7 di atas selesai, PARA PENGADU seringkali meminta salinan Akta Perjanjian Kredit Nomor: 75, tanggal 24 Agustus 2017 tersebut kepada TERADU namun tidak pernah mau untuk diberikan  karena PARA PENGADU memandang memiliki hak untuk menerima, menyimpan, membaca dan mengetahui klausula yang ada pada Akta Nomor: 75 in cassu agar PARA PENGADU tidak memiliki dugaan sebagai Debitur/Nasabah, sehingga sangat aneh bila Akta Nomor: 75 baru bisa PARA PENGADU terima dari PT. BANK TABUNGAN NEGARA (Persero) Tbk  bukan dari TERADU yaitu pada hari Senin, 25 September 2023;      9.	Bahwa ternyata saat PARA PENGADU menerima dan membaca  terkait klausula Perjanjian Kredit/Perjanjian Pokok terkait keberadaan jaminan sebagaimana maksud pada angka 3 dan 4 di atas telah ditegaskan pada Pasal 6 angka 1 tentang Jaminan Kredit dalam Akta Perjanjian Kredit Nomor: 75, tanggal 24 Agustus 2017, yang mengatakan:  1.	&ldquo;Penerima kredit diwajibkan terlebih dahulu menyediakan benda dan/atau hak yang cukup untuk diserahkan kepada BANK sebagai jaminan dan memeliharanya secara terus menerus&rdquo;;  10.	Bahwa berikutnya berdasarkan Pasal 6 angka 2 Romawi I tentang Jaminan Kredit dalam Akta Perjanjian Kredit Nomor: 75, tanggal 24 Agustus 2017, TERADU membuat &ldquo;jaminan-jaminan itu terdiri atas&rdquo;:  I.	&ldquo;Jaminan Pokok, berupa 1 (satu) bidang tanah: &bull;	Sertipikat Hak Guna Bangunan Nomor: 66/Desa Nyerot seluas 12.350 M2 (dua belas ribu tiga ratus lima puluh meter persegi) demikian diuraikan dalam Surat Ukur Sementara tanggal 31 Desember 1981 Nomor: 677/1981 dengan Nomor Identifikasi Bidang Tanah (NIB): 23020604. 02268 terdaftar atas nama PT. RAJAWALI PROPERTY LOMBOK;  II.	Jaminan Tambahan, berupa 1 (satu) bidang tanah:  &bull;	Sertipikat Hak Milik No. 248, tanggal 28 Desember 2018, Surat Ukur No. 253/Mertak Tombok/2012 tanggal 28 Desember 2012, Luas: 3.398 M2, atas nama pemegang hak: SAHRI (PENGADU 2), terletak di Desa Mertak Tombok, Kecamatan Praya, Kabupaten Lombok Tengah, Provinsi Nusa Tenggara Barat;  Bahwa bila PARA PENGADU mencermati Pasal 6 angka 2 Romawi I terkait jaminan pokok di atas sangat jelas terlihat bahwa TERADU memasukkan jaminan Sertipikat Hak Guna Bangunan Nomor: 66/Desa Nyerot seluas 12.350 M2, Surat Ukur Sementara tanggal 31 Desember 1981 Nomor: 677/1981 terdaftar atas nama PT. RAJAWALI PROPERTY LOMBOK sebagai jaminan pokok sementara jaminan pokok yang telah PARA PENGADU serahkan kepada TERADU adalah Sertipikat Hak Milik No. 66, tanggal 7 Januari 1982, Surat Ukur No. 677/1981 tanggal 31 Desember 1981, Luas: 12.350 M2, atas nama pemegang hak: HAJI MOHAMAD NASIB, terletak di Desa Nyerot, Kecamatan Jonggat, Kabupaten Lombok Tengah, Provinsi Nusa Tenggara Barat sebagaimana PARA PENGADU uraikan pada angka 3 diatas;  Bahwa kemudian Sertipikat Hak Guna Bangunan atas nama PT. RAJAWALI PROPERTY LOMBOK tahun 1981 yang ada di dalam Akta Perjanjian Kredit Nomor: 75, tanggal 24 Agustus 2017 adalah tidak benar karena PT. RAJAWALI PROPERTY LOMBOK pertama kali lahir atau berdiri pada tahun 2016 berdasarkan Akta Pendirian Nomor: 113, tanggal 29 Agustus 2016, AHU-0038770.AH.01.01.TAHUN 2016 tertanggal 31 Agustus 2016 dan Akta Perubahan Nomor: 24, tanggal 27 Juli 2017, AHU-AH.01.03-0159781 tertanggal 7 Agustus 2017 dibuat dihadapan RETNO KUSBANDINI, S.H., M.Kn, Notaris di Kabupaten Lombok Tengah;    Bahwa pertanyaan PARA PENGADU kemudian, SHGB yang dicantumkan oleh TERADU sebagai jaminan pokok pada Akta Nomor: 75 tersebut datanya dari mana? dan pemegang hak atas nama PT. RAJAWALI PROPERTY LOMBOK