 KODE ETIK NOTARIS DAN/ATAU PELANGGARAN PELAKSANAAN JABATAN NOTARIS;    13.	Bahwa keanehan berikutnya yaitu TERADU menerbitkan Surat Kuasa Membebankan Hak Tanggungan (SKMHT) Nomor: 100, tertanggal 30 Januari 2018 milik PENGADU 2 yang diikuti dengan Akta Pemberian Hak Tanggungan (APHT) Nomor: 59/2018, tertanggal 14 Februari 2018 dan Sertifikat Hak Tanggungan Nomor: 261/2018, tertanggal 28 Februari 2018 atas Sertipikat Hak Milik No. 248, tanggal 28 Desember 2018, Surat Ukur No. 253/Mertak Tombok/2012 tanggal 28 Desember 2012, Luas: 3.398 M2, atas nama pemegang hak: SAHRI (PENGADU 2), terletak di Desa Mertak Tombok, Kecamatan Praya, Kabupaten Lombok Tengah, Provinsi Nusa Tenggara Barat, padahal PARA PENGADU sama sekali tidak pernah ada tandatangan setelah 24 Agustus 2017 sebagaimana maksud pada angka 11 di atas, meskipun demikian, bila PARA PENGADU cermati letak MEREKAYASA KETERANGAN, MEMALSUKAN KETERANGAN dan/atau MEMBUAT KETERANGAN PALSU pada Akta Autentik dalam SKMHT Nomor: 100 tertanggal 30 Januari 2018 atas nama PENGADU 2 yang dilakukan oleh TERADU, yaitu:   a.	Bahwa SKMHT Nomor: 100 tertanggal 30 Januari 2018 atas nama PENGADU 2 seharusnya dibuat/diterbitkan pada hari, tanggal, bulan dan tahun sebagaimana penerbitan Akta Perjanjian Kredit Nomor: 75, tanggal 24 Agustus 2017, hal mana SKMHT Nomor: 100 adalah berkas yang ditandatangani oleh PARA PENGADU pada tanggal 24 Agustus 2017 bukan ditandatangani tanggal 30 Januari 2018 b.	Bahwa SKMHT Nomor: 100 tertanggal 30 Januari 2018 atas nama PENGADU 2 seharusnya dibuat/diterbitkan pada hari, tanggal, bulan dan tahun sebagaimana penerbitan Akta Perjanjian Kredit Nomor: 75, tanggal 24 Agustus 2017, hal mana SKMHT Nomor: 100 terbit 5 (lima) bulan berikutnya sejak penerbitan Akta Perjanjian Kredit Nomor: 75, sangat jelas TERADU telah melanggar Pasal 15 Ayat (3) dan Ayat (6) Undang-Undang Nomor 4 Tahun 1996 Tentang Hak Tanggungan Atas Tanah Beserta Benda-Benda Yang Berkaitan Dengan Tanah, yang berbunyi:  &ldquo;(3) Surat Kuasa Membebankan Hak Tanggungan mengenai hak atas tanah yang sudah terdaftar wajib diikuti dengan pembuatan Akta Pemberian Hak Tanggungan selambat-lambatnya 1 (satu) bulan sesudah diberikan&rdquo;;  Bahwa kemudian ditegaskan oleh Pasal 15 Ayat (6), yaitu:  &ldquo;(6) Surat Kuasa Membebankan Hak Tanggungan yang tidak diikuti dengan pembuatan Akta Pemberian Hak Tanggungan dalam waktu yang ditentukan sebagaimana yang dimaksud pada ayat (3) atau ayat (4), atau waktu yang ditentukan menurut ketentuan sebagaimana yang dimaksud pada ayat (5) batal demi hukum&rdquo;;  Dengan demikian cukup berdasar bila SKMHT Nomor: 100 tertanggal 30 Januari 2018 atas nama PENGADU 2 dinyatakan PERBUATAN TERCELA serta sangat terang dan jelas perbuatan TERADU telah melakukan PELANGGARAN KODE ETIK NOTARIS DAN/ATAU PELANGGARAN PELAKSANAAN JABATAN NOTARIS; Bahwa berdasarkan uraian fakta hukum di atas, maka tindakan TERADU juga bertentangan dan telah melanggar Pasal 16 ayat (1) huruf a Undang-Undang  Nomor 30 Tahun 2004 tentang Jabatan Notaris, yang mengatakan:  (5)	&ldquo;Dalam menjalankan jabatannya, Notaris wajib: c.	bertindak amanah, jujur, saksama, mandiri, tidak berpihak, dan menjaga kepentingan pihak yang terkait dalam perbuatan hukum&rdquo;;  Bahwa Pasal 16 ayat (12) menegaskan, bahwa:  (6)	&ldquo;Selain dikenai sanksi sebagaimana dimaksud pada ayat (11), pelanggaran terhadap ketentuan Pasal 16 ayat (1) huruf j dapat menjadi alasan bagi pihak yang menderita kerugian untuk menuntut penggantian biaya, ganti rugi, dan bunga kepada Notaris&rdquo;;  Bahwa sangat terang dan jelas uraian fakta hukum dan dasar hukum di atas TERADU telah melakukan PELANGGARAN KODE ETIK NOTARIS DAN/ATAU PELANGGARAN PELAKSANAAN JABATAN NOTARIS sebagaimana bunyi Pasal 16 ayat (1) huruf a Undang-Undang  Nomor 30 Tahun 2004 tentang Jabatan Notaris di atas;   14.	Bahwa berdasarkan semua uraian di atas, sangat terlihat jelas bahwa TERADU telah melanggar Pasal 9 Ayat (1) huruf c dan Pasal 85 huruf a, b, c, d, dan e Undang-Undang Nomor 2 Tahun 2014 tentang Perubahan Atas Undang-Undang Nomor 30 Tahun 2004 tentang Jabatan Notaris, yaitu:    Pasal 9 Ayat (1) huruf c dan huruf d  &ldquo;(1) Notaris diberhentikan sementara dari jabatannya karena: a.	dalam proses pailit atau penundaan kewajiban pembayaran utang; b.	berada di bawah pengampuan; c.	melakukan perbuatan tercela; d.	melakukan pelanggaran terhadap kewajiban dan larangan jabatan serta kode etik Notaris; atau  e.	sedang menjalani masa penahanan&rdquo;.  Pasal 85 huruf a, b, c, d, dan e &ldquo;Pelanggaran ketentuan sebagaimana dimaksud dalam Pasal 7, Pasal 16 ayat (1) huruf a, Pasal 16 ayat (1) huruf b, Pasal 16 ayat (1) huruf c, Pasal 16 ayat (1) huruf d, Pasal 16 ayat (1) huruf e, Pasal 16 ayat (1) huruf f, Pasal 16 ayat (1) huruf g, Pasal 16 ayat (1) huruf h, Pasal 16 ayat (1) huruf i, Pasal 16 ayat (1) huruf j, Pasal 16 ayat (1) huruf k, Pasal 17, Pasal 20, Pasal 27, Pasal 32, Pasal 37, Pasal 54, Pasal 58, Pasal 59, dan/atau Pasal 63, dapat dikenai sanksi berupa: a.	teguran lisan; b.	teguran tertulis; c.	pemberhentian sementara; d.	pemberhentian dengan hormat; atau  e.	pemberhentian dengan tidak hormat&rdquo;.', 'I NYOMAN ALIT,SH,M.Kn selama ini  tidak mau memberikan salinan perjanjian kredit kepada kami walaupun kami sering minta , alasan nya semua sudah diserahkan ke BANK', 'file/PERJANJIAN_KREDIT_RAJAWALI_PROPERTI_DAN_BANK_BTN.pdf', 373, NULL, 'konfirmasi', 364, NULL, NULL, '2023-11-27 07:12:00', '2023-11-27 08:42:42', NULL, NULL);
