INSERT INTO `tbl_pengaduan` VALUES (143, 2, 25, '1. Penyalahgunaan wewenang yakni menahan dari pembeli, melakukan pembayaran cicil kepada Penjual, dan menahan PPH.  2. Dalam PJB tidak membuat secara terang alamat kantor dan No.HPP/WA Pihak pertama/Pembeli selaku Direktur PT.MULDER. 3. Pada isi PJB lembar ke 4, angka 3, : Pembayaran ketiga setelah diterbitkan HGB, hal ini merugikan kami selaku penjual.', 'Permohonan :\r\n1. Memerintahkan yang bersangkutan mengembalikan uang kepada Penjual untuk pembayaran PPH oleh Penjual\r\n2. Memerintahkan untuk melakuakn perubahan isi PJB tentang alamat dan Nomor HP PT.Mulder\r\n3. Untuk kepastian hukum, memerintahkan untuk merubah isi PJB lembar ke 4 angka 3 ... karena kontradiksi dengan isi AJB.\r\n4. Hal-hal yang belum jelas Kami siap menghadap untuk memberikan keterangan lebih lanjut\r\nTerima kasih', 'file/1._PJB_Gabung.pdf', 893, NULL, 'proses', NULL, NULL, NULL, '2025-06-05 22:08:01', NULL, NULL, NULL);
